import React, { useState } from 'react';
import './Navbar.css';
import logo from '../assets/logo.png';

// Images explicatives
import guide1 from '../assets/regles/A4 - 1.png';
import guide2 from '../assets/regles/A4 - 2.png';
import guide3 from '../assets/regles/A4 - 3.png';
import guide4 from '../assets/regles/A4 - 4.png';
import guide5 from '../assets/regles/A4 - 5.png';
import guide6 from '../assets/regles/A4 - 6.png';
import guide7 from '../assets/regles/A4 - 7.png';
import guide8 from '../assets/regles/A4 - 8.png';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isGuideOpen, setIsGuideOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const openGuide = () => {
    setIsGuideOpen(true);
  };

  const closeGuide = () => {
    setIsGuideOpen(false);
  };

  return (
    <>
      <nav className="navbar">
        <div className="navbar-left">
          <button className="menu-button" onClick={toggleMenu}>
            ☰ Menu
          </button>
          {isMenuOpen && (
            <div className="dropdown-menu">
              <a href="/Login"><button>Mon compte</button></a>
              <button>Présentation du jeu</button>
              <button>Fonctionnalités</button>
              <button>À propos de nous</button>
              <a href="/"><button>Quitter</button></a>
            </div>
          )}
          <img src={logo} alt="Cyber@Hack" className="logo" />
          <span className="game-name">Cyber@Hack</span>
        </div>
        <div className="navbar-right">
          <a href="/"><button>Accueil</button></a>
          <span>|</span>
          <button>Règles du jeu</button>
          <span>|</span>
          <button onClick={openGuide}>Guide</button>
          <span>|</span>
          <a href="/Login"><button>Compte</button></a>
        </div>
      </nav>

      {/* Fenêtre modale */}
      {isGuideOpen && (
        <div className="modal-overlay" onClick={closeGuide}>
          <div className="modal-content" onClick={(e) => e.stopPropagation()}>
            <span className="close-button" onClick={closeGuide}>✖</span>
            <h2>Guide du jeu</h2>
            <div className="guide-images">
              <img src={guide1} alt="Guide étape 1" />
              <img src={guide2} alt="Guide étape 2" />
              <img src={guide3} alt="Guide étape 3" />
              <img src={guide4} alt="Guide étape 4" />
              <img src={guide5} alt="Guide étape 5" />
              <img src={guide6} alt="Guide étape 6" />
              <img src={guide7} alt="Guide étape 7" />
              <img src={guide8} alt="Guide étape 8" />
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default Navbar;
